import { MDBCol, MDBContainer, MDBRow } from "mdbreact";
import React, { useState } from "react";
import "./MyAccount.scss";

function MyAccount() {
  const [state, setstate] = useState(2);

  return (
    <div>
      <MDBContainer>
        <div className="my-5 w-100 pt-5">
          <h1 className="w-100 text-center font-weight-bold">My Account</h1>
        </div>

        <MDBRow>
          <MDBCol sm="12" md="2">
            <div className="card rounded">salom</div>
          </MDBCol>
          <MDBCol sm="12" md="10">
            <div>
              {() => {
                switch (state) {
                  case 1:
                    console.log("====================================");
                    console.log("this is switch");
                    console.log("====================================");
                    break;
                  case 2:
                    return <div>tab 2</div>;
                    break;
                  case 3:
                    return <div>tab 3</div>;
                    break;
                  case 4:
                    return <div>tab 4</div>;
                    break;
                  default:
                    return <div>default</div>;
                }
              }}
            </div>
          </MDBCol>
        </MDBRow>
      </MDBContainer>
    </div>
  );
}

export default MyAccount;
